  `sinaweibo` varchar(255) DEFAULT NULL,
  `tencentweibo` varchar(255) DEFAULT NULL,
  `tbshopurl` varchar(500) DEFAULT NULL,
  `ppshopurl` varchar(500) DEFAULT NULL,
  `province` int(11) DEFAULT NULL,
  `city` int(11) DEFAULT NULL,
  `address` varchar(255) DEFAULT NULL,
  `logo` varchar(255) DEFAULT NULL,
  `logo2` varchar(255) NOT NULL,
  `weblogo` varchar(500) DEFAULT NULL,
  `qrcode` varchar(255) DEFAULT NULL,
  `qrcode2` varchar(255) NOT NULL,
  `webqrcode` varchar(500) DEFAULT NULL,
  `iscomment` tinyint(4) NOT NULL DEFAULT '1',
  `ghweixin` varchar(50) DEFAULT NULL,
  `realname` varchar(50) DEFAULT NULL,
  `phone` varchar(50) DEFAULT NULL,
  `qq` varchar(50) DEFAULT NULL,
  `content` text,
  `tag` varchar(50) DEFAULT NULL,
  `zhiding` tinyint(4) DEFAULT NULL,
  `curtuijian` tinyint(4) DEFAULT NULL,
  `tuijian` tinyint(4) DEFAULT NULL,
  `xh` int(11) NOT NULL,
  `nxh` int(11) NOT NULL,
  `xingji` smallint(2) DEFAULT NULL,
  `ip` varchar(20) DEFAULT NULL,
  `hits` int(11) NOT NULL,
  `listorder` int(11) NOT NULL DEFAULT '0',
  `status` tinyint(1) NOT NULL,
  `qun_shang_xian` smallint(6) NOT NULL COMMENT '群上限人数',
  `renshu` int(8) NOT NULL COMMENT '群人数',
  `renzheng` tinyint(1) NOT NULL COMMENT '认证',
  `maidian` varchar(500) NOT NULL COMMENT '卖点',
  `img1` varchar(256) NOT NULL COMMENT '货源图片1',
  `img2` varchar(256) NOT NULL COMMENT '货源图片2',
  `img3` varchar(256) NOT NULL COMMENT '货源图片3',
  `img4` varchar(256) NOT NULL COMMENT '货源图片4',
  `img5` varchar(256) NOT NULL COMMENT '货源图片5',
  `create_time` int(11) NOT NULL,
  `update_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=5393 DEFAULT CHARSET=utf8");
