E_D("replace into `wxq_weixin` values('4983','1423016001','7','1','56','1','25','one335','韩束','','','','yuyu201212228001','','','','','','2','-1',NULL,'/../../..//Uploads/php_avatar1_20150204101307_129_QBW41MRO.jpg','/../../..//Uploads/14230160001141.jpg','','/../../..//Uploads/php_avatar1_20150120113003_181_34LU6HE4.jpg','/../../..//Uploads/14230160001861.jpg','','1','','','','','&lt;p style=&quot;font:14px/22.39px &amp;quot;microsoft yahei&amp;quot;, simhei;margin:0px;padding:0px;color:#000000;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;border-top-color:#DADADA;border-top-width:1px;border-top-style:dashed;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;&quot; class=&quot;dash_t&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span class=&quot;Apple-converted-space&quot;&gt;&amp;nbsp;&lt;/span&gt;韩束墨菊巨补水套盒产品使用说明&amp;nbsp;&lt;br /&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;font:14px/22.39px &amp;quot;microsoft yahei&amp;quot;, simhei;margin:0px;padding:0px;color:#000000;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;现代女性基本上都有一种或几种以上的护肤品，特别是寒冷的冬天，补水保湿的这个代名词就更为重要了。可是又有几个能真正做好补水保湿的呢？可能都会说，我用了什么品牌，什么高昂贵的产品，怎么还是不够保湿呢？其实补水保湿很简单。下面我就给大家分享一下护肤心得，每天使用产品的步骤：洁面+补水露+精华素+补水乳+粉BB。一：很多人对于护肤的理解第一步就是进行面部清洁，的确，&amp;nbsp;洗脸是保养面部皮肤的基础功课。洗干净了，洁净度及吸收力都能加倍。相反，如果洁面工作没有话，即使你后续涂了再昂贵的美白爽肤水，精华液等等，也都是徒劳的事情。洗脸是每天都要做的事情，如此重大的工程，我们除了要细心的挑选一款适合自己的洗面奶以外，更加要注意洁面乳的使用方法。将洁面乳挤出有一元钱币那么大小，参杂一些水搓泡后，从最易分泌油脂的t字进行上下清洁，接着以划圈的方式清洁自己的额头，最好是以逆时针的方式进行清洁，将剩余的少许的洗面奶顺势下移，直到脸颊两侧，而对于眼周的皮肤，只要由中而外轻轻带过，占到洁面乳，清洁几下子就行了，下面就是嘴角周围的皮肤清洁了，我们要注意抿一下嘴，对唇周围进行适度清洁，以免洁面乳渗入口中，用温水，最好是流动的水将脸上的泡沫洗净，擦干面部即可。二：使用墨菊深度补水露，我们将适量的补水露倒在化妆棉上面，第一遍我们都知道将这个化妆棉轻轻地擦拭我们脸部的肌肤，因为这个补水露里面除了可以强劲的补水以外，我们其实还可以起到二次清洁的功效，打开肌肤的一个吸收通道，其实我们在洗脸的时候通常会有一些脸部的边边角角，或者说没有洗到的部位，它是有残留的，我们会发现面部化妆棉沾取补水露去擦拭一遍的话，脸上其实还有一些杂志或者说没有清洗到位的地方，那么这个时候呢，我建议大家通常使用补水露可以去擦2遍，因为它能起到一个2次清洁加打开肌肤吸收通道的功能。会为后面精华液的补充起到一个非常好的效果。（擦拭的时候要由上往下，由里往外轻拭肌肤，起到提拉紧致的作用）三：精华液用量不需要太多，建议挤2下的量就够用了，精华建议用双手的去涂抹，可以让肌底水分源源不断的保存在肌肤里，当我们在涂精华液的时候，一定要记住要将我们手上的精华均匀的涂在整个脸部，包括像嘴角，鼻梁以及鼻翼两侧细小的地方都要涂抹到。四：锁住，取量也是建议大家按2下就可以满足整脸的需求了，将乳液均匀的取在小粉扑上面，从脸颊两侧开始慢慢地按推，均匀的将乳液覆盖在皮肤表面，因为这个时候乳液只是起到滋润和锁水的功能，薄薄的一层就可以了。切记要将乳液均匀的涂抹到包括像是发际线，下巴的地方都可以去擦到。五：提亮，如果说大家今天非常需要一个裸妆的妆容，不需要太多的彩妆和非常厚重的粉质感，那么就可以用这款魔力水珠保湿BB霜了。涂BB霜的时候非常的简单，在整脸的肌肤打完之后，我们会发现有一些细小的地方我们会去涂抹到，要注意一些非常暗沉的地方，比如嘴角，鼻翼，鼻沟，发际线等易忽视部位。最后用一点一点的量在我们眼周，因为有些女孩子会有出油的状况，所以可以缓解水油问题。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;','','0','0','0','0','0','5','120.6.154.175','112','0','1','0','0','1','绝对正品，绝对低价，市面上最火的护肤品，最主要的是回头客多','/../../..//Uploads/php_source_20150204101245_368_6E9QGQYA.jpg?angle=0&amp;zoom=1&amp;x=1&amp;y=43.5&amp;x1=1&amp;y1=1&amp;w=298&amp;h=298&amp;b=0&amp;c=0&amp;s=0','/../../..//Uploads/php_source_20150204101256_877_ZK82CYPE.jpg?angle=0&amp;zoom=1&amp;x=51&amp;y=1&amp;x1=1&amp;y1=1&amp;w=298&amp;h=298&amp;b=0&amp;c=0&amp;s=0','','','','1421724609','1423016001');");
