E_D("replace into `wxq_weixin` values('5004','0','0','1','56','1','25','one335','仟草佰露金蚕丝面膜','','','木子','hi77733','','','','','','-1','-1',NULL,'/../../..//Uploads/php_avatar1_20150204094657_994_JJZGFPUG.jpg','/../../..//Uploads/14230151793824.jpg','','/../../..//Uploads/php_avatar1_20150204094713_402_JZR10ZJS.jpg','/../../..//Uploads/14230151792872.jpg','','1','','','','752086759','&lt;p&gt;金蚕丝概述&lt;br /&gt;金蚕茧是由蚕丝组成的球体，蚕丝之间的连结物质就是水解蚕丝蛋白，蚕茧&lt;br /&gt;&amp;nbsp;&amp;nbsp;金蚕丝面膜&lt;br /&gt;的水解蚕丝蛋白能保湿及预防肌肤干燥。金蚕丝面膜本是用于医学界处理烫伤的仿生真皮——“蚕丝薄膜”。由于蚕丝中含有对人体极具营养价值的28种氨基酸，属多孔性物质，透气性好，吸水性极佳，在美国和日本被广泛用于手术过后伤口敷料、烧伤创面敷料来使用，有助于创面愈合且无刺激，被著称为“人工皮肤”。蚕丝面膜目前正成为取代无纺布面膜的革命性产品。&lt;/p&gt;&lt;p&gt;&lt;br /&gt;金蚕丝6大功效&lt;br /&gt;1、功效持久的保湿能力，滋润肌肤　&lt;br /&gt;2、自然修复表皮，抗皱除皱，促进胶原蛋白的分泌&lt;br /&gt;3、强效换白，收缩毛孔，淡化色斑　&lt;br /&gt;4、抗UV作用　&lt;br /&gt;5、抗发炎、痘疱能力&amp;nbsp;&lt;br /&gt;6、美白去黄&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;','','0','0','0','0','0','5','120.6.154.175','147','0','1','0','0','1','厂家一手货源，做微商就要选择好的产品，仟草佰露金蚕丝面膜好评100%，通过各种检测，通过了“菲特备案”，各大电视台轮流广告，公司实力雄厚，做微商首选的产品，10盒起公司授权，一对一培训出货','/../../..//Uploads/php_source_20150204094634_916_NQZUTAHW.jpg?angle=0&amp;zoom=1&amp;x=1&amp;y=1&amp;x1=1&amp;y1=1&amp;w=298&amp;h=298&amp;b=0&amp;c=0&amp;s=0','/../../..//Uploads/php_source_20150204094645_288_RTZ0URQT.jpg?angle=0&amp;zoom=1&amp;x=62.2&amp;y=1&amp;x1=1&amp;y1=1&amp;w=298&amp;h=298&amp;b=0&amp;c=0&amp;s=0','','','','1423014444','1423015179');");
