E_D("replace into `wxq_weixin` values('5250','1437388428','1','1','63','1','228','suilili1231','德国进口卫生巾海伦哈伯（HelenHarper)中国官方微团诚招代理','','','德国进口卫生巾海伦哈伯','2235538145','','','','','','-1','-1',NULL,'/../../..//Uploads/php_avatar1_20150720183017_273_RWQHXBL3.jpg','/../../..//Uploads/14373884281876.jpg','','/../../..//Uploads/php_avatar1_20150720183031_965_ZIQAT3YA.jpg','/../../..//Uploads/14373884289286.jpg','','1','','','','','&lt;div class=&quot;para&quot; style=&quot;color:#333333;margin:15px 0px 5px;text-indent:2em;line-height:24px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#ffffff;&quot;&gt;&lt;span style=&quot;text-indent:2em;&quot;&gt;海伦哈伯（Helen Harper）品牌诞生于上世纪50年代的德国迪森（Diessen）是欧洲最著名的一次性卫生用品制造商安泰士（Ontex）集团旗下的主要品牌之一。安泰士（Ontex）集团是一家有着半个多世纪历史，集设计、研发、生产、销售为一体的欧洲大型医疗保健企业集团，总部位于比利时。在德国、法国、西班牙、意大利、英国、捷克、波兰、及匈牙利和土耳其等国都有其生产研发及销售中心。&lt;/span&gt;&lt;p&gt;海伦哈伯系列产品采用国际最先进的生产设备，按照欧洲最高生产安全标准生产。获得多个欧洲质量标准认证：通过英国皇家认可委员会（UKAS）的ISO900质量认证、英国零售商协会（BRC）的质量认证和比利时Ontex实验室权威检测，并通过中国进出口检验检疫部门和中国海关的质量安全检测。&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-family:微软雅黑, &amp;#39;microsoft yahei&amp;#39;;font-size:16px;&quot;&gt;中国官方宣传视频&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;embed type=&quot;application/x-shockwave-flash&quot; class=&quot;edui-faked-video&quot; pluginspage=&quot;http://www.macromedia.com/go/getflashplayer&quot; src=&quot;http://player.youku.com/player.php/sid/XMTI3MDE1MTkxNg==/v.swf&quot; width=&quot;420&quot; height=&quot;280&quot; align=&quot;none&quot; wmode=&quot;transparent&quot; play=&quot;true&quot; loop=&quot;false&quot; menu=&quot;false&quot; allowscriptaccess=&quot;never&quot; allowfullscreen=&quot;true&quot; /&gt;&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;&lt;/div&gt;','','0','0','0','0','0','5','122.157.179.28','157','0','1','0','0','1','欧洲最大卫生用品制造商Ontex(安泰士)集团旗下品牌 纯德国进口  世界领先技术生产 优选食品级原材料 零化学添加不含荧光剂 纯高分子吸水无绒毛浆 超薄1毫米 木糖醇级背胶  通过英国皇家认可委员会（UKAS）质量认证、英国零售商协会（BRC）的质量认证 摩纳哥公主专款护垫供应商','/../../..//Uploads/php_source_20150720183144_294_J7YNCQTI.jpg?angle=0&amp;zoom=0.9&amp;x=60.2&amp;y=16&amp;x1=26&amp;y1=23&amp;w=272&amp;h=272&amp;b=0&amp;c=0&amp;s=0','/../../..//Uploads/php_source_20150720183208_183_K7D0SID3.jpg?angle=0&amp;zoom=0.9&amp;x=49.75&amp;y=16&amp;x1=16&amp;y1=9&amp;w=271&amp;h=271&amp;b=0&amp;c=0&amp;s=0','/../../..//Uploads/php_source_20150720183231_751_QR4EZ0AE.jpg?angle=0&amp;zoom=1&amp;x=1&amp;y=50.7&amp;x1=9&amp;y1=7&amp;w=290&amp;h=290&amp;b=0&amp;c=0&amp;s=0','/../../..//Uploads/php_source_20150720183306_865_MPOS9P6L.jpg?angle=0&amp;zoom=1&amp;x=1&amp;y=1&amp;x1=1&amp;y1=1&amp;w=298&amp;h=298&amp;b=0&amp;c=0&amp;s=0','/../../..//Uploads/php_source_20150720183328_911_Z5QCR0V6.jpg?angle=0&amp;zoom=1&amp;x=1&amp;y=10.35&amp;x1=11&amp;y1=5&amp;w=286&amp;h=286&amp;b=0&amp;c=0&amp;s=0','1437388428','1437388428');");
