E_D("replace into `wxq_weixin` values('5377','0','0','1','56','1','25','one335','莎丽汉森水光针','','','莎丽汉森水光针','one335','','','','','','2','-1',NULL,'/../../..//Uploads/php_avatar1_20150829151145_627_8213UEZV.jpg','/../../..//Uploads/14408323168859.jpg','','/../../..//Uploads/php_avatar1_20150826171839_382_MDUDE4E6.jpg','/../../..//Uploads/14408323162107.jpg','','1','','','','373584167','&lt;p style=&quot;text-align:left;&quot;&gt;莎丽汉森&amp;nbsp;密集活焕水光剂5ml&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;text-align:left;&quot;&gt;水光针是2015年全球最流行的微整形项目，因为使用后会让皮肤变得水光白嫩，也是众多名媛和明星最爱的美容项目！&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;text-align:left;&quot;&gt;透明质酸(Hyaluronic&amp;nbsp;Acid)又称玻尿酸，本身是一种构成人体的天然物质，所以对人体没有副作用和排斥反应。透明质酸对皮肤保湿有重要作用，同20~30岁的肌肤相比，30~40岁时人体透明质酸的含量是75%，40岁以上只有60%，皮肤老化过程中人体会减少透明质酸，且皮肤弹力下降，产生细纹。&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;text-align:left;&quot;&gt;这时注入透明质酸可以提升水分保持能力，使皮肤滋润透亮，有效改善肤质，让肌肤重回年轻态，适合各种肤质类型，敏感性类型肤质也可以做水光针。在日韩娱乐圈内，已经被艺人们当做“日常护肤之宝”，在台湾、香港的演艺圈内也成为众所周知的秘密。&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;text-align:left;&quot;&gt;水光针的11项强大功效：抗氧化、提亮肤色、淡化黑色素、补水保湿、淡化痘印、收缩毛孔、抗皱、提拉紧致、舒缓过敏、修复基底细胞、深层净化。&amp;nbsp;一步到位，适合所有肤质，保证你的脸通透白嫩，光滑有弹性。&amp;nbsp;男女老少都能用！&lt;/p&gt;&lt;p style=&quot;text-align:left;&quot;&gt;&amp;nbsp;&lt;br style=&quot;text-align:left;&quot; /&gt;水光针的成分都是天然的，无激素，无刺激，无铅汞，过敏皮肤，孕妇都是可以用。&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;text-align:left;&quot;&gt;水光针的成分：小分子玻尿酸、小分子胶原蛋白、复合因子&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;text-align:left;&quot;&gt;功效：补充肌肤水分、提亮肤色改善暗沉&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;text-align:left;&quot;&gt;使用方法：洁肤后，取适量微精华均匀涂抹于脸部肌肤。&amp;nbsp;&amp;nbsp;&lt;/p&gt;','','0','0','0','0','0','5','120.6.179.24','21','0','1','0','0','1','莎丽汉森 密集活焕水光剂','/../../..//Uploads/php_source_20150826171806_457_B1TYIC5Q.jpg?angle=0&amp;zoom=1&amp;x=4.1&amp;y=1&amp;x1=1&amp;y1=1&amp;w=298&amp;h=298&amp;b=0&amp;c=0&amp;s=0','/../../..//Uploads/php_source_20150826171910_925_OAYS6LRZ.jpg?angle=0&amp;zoom=1&amp;x=1&amp;y=1&amp;x1=1&amp;y1=3&amp;w=296&amp;h=296&amp;b=0&amp;c=0&amp;s=0','/../../..//Uploads/php_source_20150826171920_966_1ZZTPNBO.jpg?angle=0&amp;zoom=1&amp;x=1&amp;y=17.3&amp;x1=1&amp;y1=1&amp;w=298&amp;h=298&amp;b=0&amp;c=0&amp;s=0','/../../..//Uploads/php_source_20150826171933_803_ZVYTWRNM.jpg?angle=0&amp;zoom=1&amp;x=2.1&amp;y=1&amp;x1=1&amp;y1=6&amp;w=293&amp;h=293&amp;b=0&amp;c=0&amp;s=0','/../../..//Uploads/php_source_20150826171948_481_Z4LI44HV.jpg?angle=0&amp;zoom=1&amp;x=5&amp;y=76.35&amp;x1=1&amp;y1=1&amp;w=298&amp;h=298&amp;b=0&amp;c=0&amp;s=0','1440580729','1440832317');");
E_D("replace into `wxq_weixin` values('5367','0','0','1','61','1','314','qwe55677','三里人家红枣黑糖姜茶','','','梦莹','qwe55677','','','','','','-1','-1',NULL,'/../../..//Uploads/php_avatar1_20150822204005_357_S8VRY5VH.jpg','/../../..//Uploads/14402473197126.jpg','','/../../..//Uploads/php_avatar1_20150822204109_91_EXYKWAQW.jpg','/../../..//Uploads/14402473198007.jpg','','1','','','','272309319','&lt;p&gt;现在的微商界，面膜、化妆品、肥皂、酵素、减肥产品泛滥，市场早已饱和，你觉得你还有赚头么？。而现在人们的养生意识逐渐增强，养生产品的市场你看到了么？&lt;/p&gt;&lt;p style=&quot;text-align:justify;text-justify:inter-ideograph;text-indent:32px;line-height:27px;background:white;vertical-align:baseline;margin-bottom:0;&quot;&gt;&lt;span style=&quot;font-size:15px;color:#444444&quot;&gt;先说说黑糖为什么会火，中国至少一半是女人，而大部分女人都会因为饮食不当，缺少运动，熬夜等都会导致月经问题，比如月经不调，提前太多，迟迟不来，痛经等等&lt;/span&gt;&lt;span style=&quot;font-size:15px;font-family:helvetica;color:#444444&quot;&gt;.....&lt;/span&gt;&lt;span style=&quot;font-size:15px;color:#444444&quot;&gt;好多中医告诉我，女人的子宫是一个人女人的发动机，如果发动机出了问题，就会导致很多其他的问题&lt;/span&gt;&lt;span style=&quot;font-size:15px;font-family:helvetica;color:#444444&quot;&gt;.&lt;/span&gt;&lt;span style=&quot;font-size:15px;color:#444444&quot;&gt;那么黑糖就能解决这个问题吗？当然不是，仅仅是黑糖是不够的，要加上红枣和姜丝，因为这是一剂药方，现在市面上很多人在卖的有很多类似的产品，不过大部分都没有认真的做过调研和深入研究，因为这三种产品放在一起会上火，我们请教了很多著名的老中医，终于找到解决的方案是：必须加上菊花，这样搭配起来就完美无瑕了。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align:justify;text-justify:inter-ideograph;text-indent:32px;line-height:27px;background:white;vertical-align:baseline;margin-bottom:0;&quot;&gt;&lt;span style=&quot;font-size:15px;color:#444444&quot;&gt;三里人家红枣黑糖姜茶是云南的特产，红枣黑糖姜茶顾名思义就是有黑糖有姜有红枣的茶，但是不是随便一种黑糖随便一种姜配出来的茶效果都好呢？答案肯定不是的！&lt;/span&gt;&lt;span style=&quot;font-size:15px;font-family:helvetica;color:#444444&quot;&gt;&lt;br /&gt;&lt;/span&gt;&lt;span style=&quot;font-size:15px;color:#444444&quot;&gt;下面我介绍下它的原料：&lt;/span&gt;&lt;span style=&quot;font-size:15px;font-family:helvetica;color:#444444&quot;&gt;&lt;br /&gt;&lt;/span&gt;&lt;span style=&quot;font-size:15px;font-family:inherit;color:red;border:none #000 1px;padding:0&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;font-size:15px;color:red;border:none #000 1px;padding:0&quot;&gt;云南黑糖：&lt;/span&gt;&lt;span style=&quot;font-size:15px;font-family:helvetica;color:#444444&quot;&gt;&lt;br /&gt;&lt;/span&gt;&lt;span style=&quot;font-size:15px;color:#444444&quot;&gt;（云南的黑糖是颜色较深的红糖，由于颜色近似黑色，被日本和台湾称为黑糖。黑糖是没有经过高度精炼、脱色的蔗糖，除了提供热能外，还含有微量元素，如钙钾，铁，镁及叶酸和其他矿物质等，具有很高的营养价值。）&lt;/span&gt;&lt;span style=&quot;font-size:15px;font-family:helvetica;color:#444444&quot;&gt;&lt;br /&gt;&lt;/span&gt;&lt;span style=&quot;font-size:15px;font-family:inherit;color:red;border:none #000 1px;padding:0&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;font-size:15px;color:red;border:none #000 1px;padding:0&quot;&gt;云南罗平小黄姜：&lt;/span&gt;&lt;span style=&quot;font-size:15px;font-family:helvetica;color:#444444&quot;&gt;&lt;br /&gt;(&lt;/span&gt;&lt;span style=&quot;font-size:15px;color:#444444&quot;&gt;俗话说，助阳有佳品，姜茶便是还魂汤。三里人家的姜丝要比姜粉好吃得多，罗平处于云南高原地带，地处于万千优势，罗平是小黄姜之乡。）&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align:justify;text-justify:inter-ideograph;text-indent:32px;line-height:27px;background:white;vertical-align:baseline;margin-bottom:0;&quot;&gt;&lt;span style=&quot;font-size:15px;font-family:helvetica;color:#FF0000;&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;font-size:15px;color:#FF0000;&quot;&gt;杭州白菊：&lt;/span&gt;&lt;br /&gt;&lt;/p&gt;&lt;p style=&quot;text-align:justify;text-justify:inter-ideograph;text-indent:32px;line-height:27px;background:white;vertical-align:baseline;margin-bottom:0;&quot;&gt;&lt;span style=&quot;font-size:15px;color:#444444&quot;&gt;（杭州白菊是和西湖龙井齐名，又称甘菊）&lt;/span&gt;&lt;span style=&quot;font-size:15px;font-family:helvetica;color:#444444&quot;&gt;&lt;br /&gt;&lt;span style=&quot;font-size:15px;font-family:helvetica;color:#FF0000;&quot;&gt;4&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size:15px;color:#FF0000;&quot;&gt;新疆若羌灰枣干：&lt;/span&gt;&lt;span style=&quot;font-size:15px;font-family:helvetica;color:#444444&quot;&gt;&lt;br /&gt;&lt;/span&gt;&lt;span style=&quot;font-size:15px;color:#444444&quot;&gt;（若要问哪里的枣好，很多人都知道是新疆的枣好，但是很多人不知道新疆的若羌灰枣干是数一数二的，而且是唯一一种在树上风干的枣）&lt;/span&gt;&lt;span style=&quot;font-size:15px;font-family:helvetica;color:#444444&quot;&gt;&lt;br /&gt;&lt;/span&gt;&lt;span style=&quot;font-size:15px;color:#444444&quot;&gt;以上是三里人家红枣姜茶的原料，所选原料都为全中国最好的原材料，它的特点独力包装，并附有配方，当然有些朋友可能会说中国生产的产品不太放心，对于那些红糖水，姜粉不太信任，为此我们把它打回了圆形，糖是一块一块的，红枣是一片一片的，姜丝是一条一条的，菊花是一朵一朵的，没有经过任何人为加过磨粉，当然，所有的&lt;/span&gt;&lt;span style=&quot;font-size:15px;font-family:helvetica;color:#444444&quot;&gt;QS&lt;/span&gt;&lt;span style=&quot;font-size:15px;color:#444444&quot;&gt;认证，食品生产资质我们都有，这不是一个三无产品。让你喝得放心！&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;','','0','0','0','0','0','5','125.39.113.44','12','0','1','0','0','1','现在的微商界，面膜、化妆品、肥皂、酵素、减肥产品泛滥，市场早已饱和，你觉得你还有赚头么？。而现在人们的养生意识逐渐增强，养生产品的市场你看到了么？\r\n三里人家红枣黑糖姜茶沿用古老配方制作，选取原生态材料精心秘制而成，正宗口感，量足实惠，男女老少皆宜，三里人家红枣黑糖姜茶尤其适合生理期女性，红枣可以养颜美容，养气补血。配料中的黑糖有益气养血，健脾暖胃，祛风散寒，活血化瘀的效果，生姜有温经散寒，暖宫驱寒的作用。三者结合可以补血养颜，暖宫健胃，益气养生，调经止疼。','/../../..//Uploads/php_source_20150822201612_91_90EFV5YN.jpg?angle=0&amp;zoom=1&amp;x=1&amp;y=1&amp;x1=1&amp;y1=1&amp;w=298&amp;h=298&amp;b=0&amp;c=0&amp;s=0','/../../..//Uploads/php_source_20150822201623_765_CKC34ARG.jpg?angle=0&amp;zoom=1&amp;x=38.5&amp;y=1&amp;x1=1&amp;y1=1&amp;w=298&amp;h=298&amp;b=0&amp;c=0&amp;s=0','/../../..//Uploads/php_source_20150822201634_909_T6ZM34X1.jpg?angle=0&amp;zoom=1&amp;x=1&amp;y=1&amp;x1=1&amp;y1=1&amp;w=298&amp;h=298&amp;b=0&amp;c=0&amp;s=0','/../../..//Uploads/php_source_20150822201645_809_CLPIC9NP.jpg?angle=0&amp;zoom=1&amp;x=1&amp;y=1&amp;x1=1&amp;y1=1&amp;w=298&amp;h=298&amp;b=0&amp;c=0&amp;s=0','/../../..//Uploads/php_source_20150822201656_649_ZQTDIW2R.jpg?angle=0&amp;zoom=1&amp;x=43.9&amp;y=1&amp;x1=1&amp;y1=1&amp;w=298&amp;h=298&amp;b=0&amp;c=0&amp;s=0','1440247319','1440247319');");
